const Header = (props) => {
    return (
        <h1>{props.title}</h1>
    )
}

const Content = (props) => {
    return (
        <p>
            {props.name} {props.amount}
        </p>
    )
}

const Total = (props) => {
    return (
        <p>Number of exercises {props.total}</p>
    )
}


ReactDOM.render(<App />, document.getElementById('root'))
